import React from 'react';
import Nav from './nav';

export default function Main() {
    return (
        <>
        <Nav />
        <div className='intro'>
            <h1>Boosted Tech Co.</h1>
            <p>Boosted Tech Co. is a full-service digital marketing agency that specializes in web design, SEO, and social media marketing. We help businesses grow their online presence and increase their revenue.</p>
        </div>
        </>
    );
}
